%[text] # Tekercs
R = 1;
L = 1e-3;

% Időállandó
tau = L/R %[output:9b1020fb]

% Állandósul állapoti erősítés
K = 1/R;

% Vágási (kör)frekvencia
omega_0 = 1/tau;

omega = (omega_0/10):(omega_0*10);

% Az ábrázolandó függvények
A = @(w) K ./ (1 + tau^2 * w.^2);
Dq = @(w) -atan(tau*w);

loglog(omega, A(omega)); %[output:22387981]
semilogx(omega, rad2deg(Dq(omega))); %[output:2e0f5ac6]


